// src/components/MenuDrawer.js
import React from 'react';
import { Drawer, List, ListItem, ListItemText, Box } from '@mui/material';

export default function MenuDrawer({ buttonColor }) {
  return (
    <Drawer
      variant="permanent"
      sx={{
        width: 240,
        flexShrink: 0,
        '& .MuiDrawer-paper': {
          width: 240,
          boxSizing: 'border-box',
          backgroundColor: '#FFFFFF',
        },
      }}
    >
      <Box sx={{ padding: 2, backgroundColor: buttonColor }}>
        <List>
          <ListItem button>
            <ListItemText primary="Início" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Configurações" />
          </ListItem>
          <ListItem>
            <ListItemText primary="Minhas Turmas:" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Turma 01" />
          </ListItem>
          <ListItem button>
            <ListItemText primary="Turma 02" />
          </ListItem>
        </List>
      </Box>
    </Drawer>
  );
}
